import './App.css';
import React from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Navbar from 'react-bootstrap/Navbar';
import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';

const NavBa = () => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg">
    <Navbar.Brand href="#home">Live-survey</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="mr-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <NavDropdown title="Ankety" id="Survey-menu">
          <NavDropdown.Item disabled href="#" tabIndex="-1" aria-disabled="true">Vytvořit anketu</NavDropdown.Item>
          <NavDropdown.Item disabled href="#" tabIndex="-1" aria-disabled="true">Veřejné ankety</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item disabled href="#" tabIndex="-1" aria-disabled="true">Smazat anketu</NavDropdown.Item>
        </NavDropdown>
        <Nav.Link href="https://github.com/EditaBozkova/LiveSurvey">Github</Nav.Link>
      </Nav>
    </Navbar.Collapse>
    <Navbar.Collapse className="justify-content-end">
          <Navbar.Text>
          <a href="https://github.com/EditaBozkova">@EditaBozkova </a>
          <a href="https://github.com/Pompino">@Pompino </a>
          </Navbar.Text>
        </Navbar.Collapse>
  </Navbar>
  );
};

const Podmenu = () => {
  return (
    <CardGroup>
  <Card>
    <Card.Body>
      <Card.Title>Základní info</Card.Title>
      <Card.Text>
      Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Nulla non arcu lacinia neque faucibus fringilla. Etiam bibendum elit eget erat.
      </Card.Text>
    </Card.Body>
    <Card.Footer>
      <small className="text-muted">Last updated 3 mins ago</small>
    </Card.Footer>
  </Card>

  <Card>
  <Card.Header>Vytvořit anketu</Card.Header>
    <Card.Body>
      <Card.Text>
        TLorem ipsum dolor sit amet, consectetuer adipiscing elit. Nulla non arcu.
      </Card.Text>
    </Card.Body>
    <Button variant="primary">Vytvořit</Button>{' '}
  </Card>

  <Card>
  <Card.Header>Veřejné ankety</Card.Header>
    <Card.Body>
      <Card.Text>
      Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Nulla non arcu to show that equal height action.
      </Card.Text>
    </Card.Body>
  </Card>
</CardGroup>
  );
};

const App = () => (
  <Container className="p-1">
    <NavBa></NavBa>
    <Jumbotron>
      <Container>
        <h1>Živé ankety</h1>
        <p>
        Vítejte na <i>jedinečné</i> webové aplikaci, která Vám pomůže vytvořit a následně sdílet živé ankety!
        </p>
        <ul>
          <li>Výběr jedné z možnosti</li>
          <li>Výběr všech hodnot, které platí </li>
          <li>Volná odpověď </li>
        </ul>
     </Container>
    </Jumbotron>
    <Podmenu></Podmenu>
  </Container>
);

export default App;
